  render() {
    return (
      <>
        <TopNavigation />
        <Footer />
      </>
    );
  }
}

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = ({
      pendingGuess:"",
      currentGuess: "",
      previousGuesses: [],
      currentNumber: "",
      previousGames: {},
    });
  }
  render() {
    return (
      <div className="App">
        <AppElements />
        <BasicForm />
      </div>
    );
  }
}
